import Axios from "../utils/axios"

const login = async (data:FormData) => {
    return await Axios.post('login',data);
}

const info = async () => {
    return await Axios.get('user/info');
}

const logout = async () => {
    return await Axios.get('user/info');
}

const authAPI = {
    login,
    info
}

export default authAPI;
